import { SpanTitulo,Container, Icone, Subtitulo } from "./Style";


const Titulo= (page) => (
    <>
        <Container>
            <Icone>
                <img src = {page.icon} alt="ícone" />
            </Icone>
            <SpanTitulo>
                {page.id}
            </SpanTitulo> 
        </Container>
        <Subtitulo>
        Visualize, baixe e compartilhe as informações do seu extrato bancário.
        </Subtitulo>
    </>
    
); 

export default Titulo;
